import React, { Component } from 'react';

class Profile extends Component {

  render() {
    return (
      <div className="main-container">
        <div
              className="standard-button"
              onClick={(event) => this.login(event)}
            >
              Logout
            </div>
      </div>
    )
  }
}

export default Profile;
